import classes from "./MealItemForm.module.css";

const MealItemForm = () => {
  return (
    <form className={classes.form}>
      <div>
        <label htmlFor="">Amount</label>
        <input type="number"  placeholder="1"/>
      </div>
      <button>+ Add</button>
    </form>
  );
};
export default MealItemForm;
